import Header from './Header';
import UHeader from './Uheader/UHeader';
import Footer from './Footer/Footer';
import Banner from './Banner/Banner';

const Layout = ({ children }) => {
    return (
        <React.Fragment>

            <Header />

            {children}
            <Footer />
        </React.Fragment>
    );
};

export default Layout;
